import "./App.scss";
import Header from "./Header";
import Home from "./pages/Home";
import About from "./pages/About";
import { useRef } from "react";

const homeRef = useRef();
const aboutRef = useRef();

function App() {
  return (
    <>
      <Header />
      <Home id={"home"} ref={homeRef} />
      <About id={"about"} ref={aboutRef} />
    </>
  );
}
export default App;
